    "2015-11-27T21:16:40.185564",nt"name": "high-resolution-orthoimagery-selected-areas-central-mn-spring-2013-1-foot-resolution",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset contains leaf-off 4-band red,
    green, blue, infrared (RGBI) digital orthophoto imagery produced at 30-centimeter
    (approximately one-foot) resolution from new aerial photography captured in Spring
    2013. The imagery covers Carlton, Clay, Itasca, Mille Lacs and Wilkin counties;
    Fond du Lac and White Earth reservations, and Camp Ripley military reservation in
    central and north-central Minnesota. Funding for this data was provided by the Minnesota
    Natural Heritage Fund, the Minnesota Clean Water Legacy Act, and The Environmental
    and Natural Resources Trust Fund. Counties and other non-state public entities named
    under 'Originator' contributed additional funding to increase the resolution of
    the imagery collect. This metadata record was created by the Minnesota Geospatial
    Information Office (MnGeo) using information supplied by Quantum Spatial, Inc. and
    the Minnesota Department of Transportation.",nt"license_title": null,nt"extras":
